import React, { useState, useEffect } from "react";
import axios from "axios";

const Component1 = () => {
  const [data, setData] = useState();
  const [loading, setLoading] = useState(true);
  let part = 1;
  let count = 0;

  let config = {
    method: "get",
    url: `http://localhost:8080/len`,
    headers: {},
  };
  useEffect(() => {
    axios(config)
      .then(function (response) {
        setData(response.data);
        setLoading(false);
      })
      .catch(function (error) {
        console.log(error);
      });
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  // Create a function that returns an unordered list of the data
  const JsonListComponent = (json) => {
    if (isObject(json)) {
      let list = [];
      for (let key in json) {
        if (json.hasOwnProperty(key)) {
          list.push(
            <li key={key}>
              {splitCamelCaseAndUppercase(key)}: {JsonListComponent(json[key])}
            </li>
          );
        }
      }
      return <ul>{list}</ul>;
    }
    return json;
  };

  return (
    <>
      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          <div>
            <JsonListComponent data={data} />
          </div>
        </div>
      )}
    </>
  );
};

export default Component1;
